INSERT INTO `v1_ff95eba610e5cfd49f9a9354190846090963420056b2a2225e139dda2057402b` VALUES (1, 0.5, 1, 0, "いや、浮世絵って\nこんな感じだったか？\nオーエドで見たのは、もう少し\n違う雰囲気だった気がするのだが。", 0, 19812, 11, 10, 105311, 19812034);
